import React from 'react';
import { UncontrolledCarousel } from 'reactstrap';

const items = [
  {
    src: 'https://www.moorpark.org.uk/wp-content/uploads/2016/07/MP_Butterfly_Room2_Content_web.jpg',
    altText: 'Slide 1',
    caption: 'Slide 1',
    header: 'Slide 1 Header',
    key: '1'
  },
  {
    src: 'https://pentagonwebcontent.blob.core.windows.net/suitability-category-picture-slide-images/68/TitleImage/800x566/outdoor-nursery-play-equipment.pentagonplay.jpg',
    altText: 'Slide 2',
    caption: 'Slide 2',
    header: 'Slide 2 Header',
    key: '2'
  },
  {
    src: 'data:image/jpeg;base64,',
    altText: 'Slide 3',
    caption: 'Slide 3',
    header: 'Slide 3 Header',
    key: '3'
  }
];

const Car = () => <UncontrolledCarousel items={items} />;

export default Car;
